    numbers
      .filter(number => number > value)
      .map(number => {
      return (
        <li className="item">{number}</li>
      );
    })
  } */

  render() {
    return (
      <div className="App">
        <ul className="list">
          {this.state.arr.map(number => {
            return (
              <li key={number}>{number}</li>
            );
          })}
        </ul>

      </div>
    );
  }
}

export default App;
